import React, { useState } from 'react';
import axios from 'axios';

const GetStudentGradeForm = () => {
  const [studentId, setStudentId] = useState('');
  const [studentName, setStudentName] = useState('');
  const [grade, setGrade] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    const studentQuery = {
      studentId: studentId || null,
      studentName: studentName || null,
    };

    axios
      .post('http://localhost:8080/getStudentGrade', studentQuery, {
        headers: {
          'Content-Type': 'application/json',
        },
      })
      .then((response) => {
        setGrade(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  const formStyle = {
    display: 'flex',
    flexDirection: 'column',
    maxWidth: '300px',
    margin: '0 auto',
  };

  return (
    <div>
      <form style={formStyle} onSubmit={handleSubmit}>
        <label>
          Student ID:
          <input type="number" value={studentId} onChange={(e) => setStudentId(e.target.value)} />
        </label>
        <br />
        <label>
          Student Name:
          <input type="text" value={studentName} onChange={(e) => setStudentName(e.target.value)} />
        </label>
        <br />
        <button type="submit">Fetch Student Grade</button>
      </form>

      {grade && <p>Grade: {grade}</p>}
    </div>
  );
};

export default GetStudentGradeForm;
